import TeamColors from './TeamColors'
export default function TeamHeader({ loading, teamName, season }){
  const colors = useContext(theme);
  const style = {
    "backgroundColor":colors.darkColor,
    "color": colors.lightColor
  }
  return(
    <header style={style}>
      <h1>{teamName}</h1>
      <h1>{season}</h1>
    </header>
  );
}
